import React from 'react';
import AppLayout from '../components/AppLayout';
import Head from 'next/head';

const Profile = () => {
  return (
    <>
      <Head>
        <title>프로필 | moving</title>
      </Head>
      <AppLayout>프로필 페이지</AppLayout>
    </>
  );
};

export default Profile;
